proxyHost=localhost
proxyPort=10080
proxyServerSocketType=Plain
remoteServerSocketType=Plain
proxyCleintToRemoteServerRequestInfoFilter=jxsource.net.httpproxy.filter.CopyRequestFilter
remoteServerToProxyCleintResponseInfoFilter=jxsource.net.httpproxy.filter.CopyResponseFilter
remoteServerSocketFactory=javax.net.SocketFactory
remoteServerSocketManager=jxsource.net.httpproxy.socket.SocketManagerImpl
entityDestinationSocketManager=jxsource.net.httpproxy.entity.ProxyHttpEntityDestinationSocketManager
entityProcessor=jxsource.net.httpproxy.entity.EntityProcessorImpl
socketAccessorManager=jxsource.net.httpproxy.socket.SingleHostSocketAccessorManager
socketAccessor=jxsource.net.httpproxy.socket.SingleHostSocketAccessor
cacheDir=c:/temp/proxyFiles
cacheMimeType=video,image
